Schema for AtlasLineageInfo: { baseEntityGuid: string, # Optional. The GUID of the base entity. guidEntityMap: Dictionary<string, AtlasEntityHeader>, # Optional. The GUID entity map. widthCounts: Dictionary<string, Dictionary<string, AnyObject>>, # Optional. The entity count in specific direction. lineageDepth: number, # Optional. The depth of lineage. lineageWidth: number, # Optional. The width of lineage. includeParent: boolean, # Optional. True to return the parent of the base entity. childrenCount: number, # Optional. The number of children node. lineageDirection: "INPUT" | "OUTPUT" | "BOTH", # Optional. The enum of lineage direction. parentRelations: [ { childEntityId: string, # Optional. The GUID of child entity. relationshipId: string, # Optional. The GUID of relationship. parentEntityId: string, # Optional. The GUID of parent entity. } ], # Optional. An array of parentRelations relations. relations: [ { fromEntityId: string, # Optional. The GUID of from-entity. relationshipId: string, # Optional. The GUID of relationship. toEntityId: string, # Optional. The GUID of to-entity. } ], # Optional. An array of lineage relations. }

